import React from "react";
import ToDo from "./component/ToDo";

import Container from "react-bootstrap";

const App = () => {
  return (
    <div className="App">
      <ToDo />

      <Container>
        <Row>
          <Col>1 of 2</Col>
          <Col>2 of 2</Col>
        </Row>
        <Row>
          <Col>1 of 3</Col>
          <Col>2 of 3</Col>
          <Col>3 of 3</Col>
        </Row>
      </Container>
    </div>
  );
};

export default App;
